const Navbar = () => {
  const uid = true;
  const user = { name: "Kathia" };
  return (
    <>
      <div>
        <header>
          <img src="../img/logo-red-cut-rsz-1.png" alt="logo groupomania" />
          {uid ? (
            <div className="nav">
              <ul>
                <li>
                  <a href="">Bienvenue {user.name}</a>
                </li>
                <li>
                  <a href="">Accueil</a>{" "}
                </li>
                <li>
                  <a href="">Votre profil</a>{" "}
                </li>
              </ul>
            </div>
          ) : (
            <></>
          )}
        </header>
      </div>
    </>
  );
};

export default Navbar;
